'From Squeak3.7alpha of ''11 September 2003'' [latest update: #5657] on 24 January 2004 at 1:37:43 am'!"Change Set:		InstallAccuFontsDate:			24 January 2004Author:			Doug Way, Bob Arning, Ned Konz, Duane MaxwellInstalls new Accufont bitmap StrikeFonts.  This also replaces most existing Squeak fonts (including the Apple NewYork font), making the Apple font clause in the Squeak license irrelevant.  The acknowledgement to Arts Management Systems Ltd.required by the Accufont license is added to the StrikeFont class comment.The Accufonts were encoded in this postscript by first installing the AccuFonts.4.sar from SqueakMap, and then appending each Accufont to a file via TextStyle>>compressedMIMEEncodedStream.Possible remaining problems:  Character widths for some punctuation characters could use some adjusting... e.g. the Accuny period character is quite wide.  Also, some fonts such as Accuny09 and Accuny10 have the same size of 12, which can cause problems for some tools.- Doug Wayv5:Converted the .sar file to a single changeset for inclusion in the update stream.  Font files are encoded and installed in the postscript.  The original Apple fonts are also replaced at the end of the postscript.v4:* Reset default sizes for system font, code font, etoys font and flaps font.* Removed SystemWindowIcons-nk.cs from the .sar (no longer needed)* Removed the Dingbats fonts (Accumo, Accuca). They clutter up the 'system fonts...' menu by appearing as jibberish, which is annoying. Also, I'm not sure we really want such obviously Apple-related dingbats in the image such as the Apple logo, compact Mac, etc., even if they were "cleanly" generated.* Added acknowledgement from the AccuFonts license (the contact info for Doug Easterbrook) to the StrikeFont class comment.  The license specifies that the acknowledgement appear somewhere, and that seemed like as good a place as any.v3:added X and O window icons if you replace the stock fonts.v2:Reduced memory usage by throwing away original font data.v1:This code is the first attempt to replace existing Squeak fonts with new ones.  The first pass replaces all instance of the existing fonts with 'Accu'  versions.  The second pass loads in additional fonts.  The transcript will show the progresson loading the various fonts.  An attempt is made to make existing windows still display, even though the font will change - in doing so, there may be duplicates of the Accuny font until those windows are closed and the garbage collector scavenges them.Per the arrangement with Arts Management Systems, Ltd, an attempt has been made to encode copyright information into the fonts.  This is done by converting the copyright notice as a bitmap in glyph 16rF0, which is unused in these fonts.  Depending upon the pointsize of the font, various versions of this notice appear.Submitted by:  Duane Maxwell, exoboxAccuFontLicense:---------------------Copyright Arts Management Systems, Ltd.© Arts Management Systems Ltd. The fonts distributed as part of this base image are derived from fonts copyright Arts Management Systems, Ltd. Use of the fonts in derivative software products is allowed.  The fonts should retain their AccuFont names. The acknowledgement should read: >Doug Easterbrook>Arts Management Systems Ltd.>mailto:doug@artsman.com>http://www.artsman.com>Phone (403) 215-5701    Fax (403) 215-5704"!!StrikeFont commentStamp: 'dew 1/1/2004 20:58' prior: 0!I represent a compact encoding of a set of Forms corresponding to characters in the ASCII character set. All the forms are placed side by side in a large form whose height is the font height, and whose width is the sum of all the character widths. The xTable variable gives the left-x coordinates of the subforms corresponding to the glyphs. Characters are mapped to glyphs by using the characterToGyphMap.Subclasses can have non-trivial mapping rules as well as different representations for glyphs sizes (e.g., not using an xTable). If so, these classes should return nil when queried for xTable and/or the characterToGlyphMap. This will cause the CharacterScanner primitive to fail and query the font for the width of a character (so that a more programatical approach can be implemented).For display, fonts need to implement two messages:	#installOn: aDisplayContext foregroundColor: foregroundColor backgroundColor: backgroundColorThis method installs the receiver (a font) on the given DisplayContext (which may be an instance of BitBlt or Canvas (or any of it's subclasses). The font should take the appropriate action to initialize the display context so that further display operations can be optimized.	#displayString: aString on: aDisplayContext from: startIndex to: stopIndex at: aPoint kern: kernDeltaThis method is called for each subsequent run of characters in aString which is to be displayed with the (previously installed) settings.--------------------------------The "AccuFont" StrikeFonts by Doug Easterbrook were added to the Squeak image for the 3.7 release.  The following acknowledgement must remain in the image (in this class comment) as long as the Accufonts are in the image:>Doug Easterbrook>Arts Management Systems Ltd.>mailto:doug@artsman.com>http://www.artsman.com>Phone (403) 215-5701    Fax (403) 215-5704!!TextStyle methodsFor: 'mime file in/out' stamp: 'nk 1/19/2004 20:27'!compressedMIMEEncodedStream	"Answer a ReadWriteStream with my compressed, stored representation as Base64"	| s ff ffcontents s2 gzs |	s _ RWBinaryOrTextStream on: ''.	ff _ SmartRefStream on: s reset.	TextConstants at: #forceFontWriting put: true.	[ ff nextPut: self ] ensure: [ TextConstants at: #forceFontWriting put: false ].	ffcontents _ s contents.	ff close.	s2 _ RWBinaryOrTextStream on: ''.	gzs _ GZipWriteStream on: s2.	gzs nextPutAll: ffcontents.	gzs close.	s2 reset.	s _ RWBinaryOrTextStream on: (ByteArray new: 10000).	Base64MimeConverter mimeEncode: s2 to: s.	^s ascii; reset! !!TextStyle class methodsFor: 'mime file in/out' stamp: 'nk 1/19/2004 20:36'!collectionFromCompressedMIMEString: aString	"aString holds a compressed, Base64 representation of a SmartRefStream storage of a TextStyle.	Install the TextStyle."	| this newName style heights data |	data := (Base64MimeConverter mimeDecode: aString as: String) unzipped.	(RWBinaryOrTextStream with: data) reset; fileIn.	this := SmartRefStream scannedObject.	"now install it"	newName _ this fontArray first familyName.	this fontArray do: [:aFont | aFont familyName = newName ifFalse: [		self error: 'All must be same family']].	style _ TextConstants at: newName asSymbol ifAbsent: [		^ TextConstants at: newName asSymbol put: this].		"new family"	this fontArray do: [:aFont | "add new fonts"		heights _ style fontArray collect: [:bFont | bFont height].		(heights includes: aFont height) ifFalse: [			style fontAt: style fontArray size + 1 put: aFont]].! !"Postscript:"	| allFonts fontName newFont nameTransformDict fontTransformDict sz |	"Install Accuny font"TextStyle collectionFromCompressedMIMEString: 'H4sIAAAAAAAAAOW9D3gU13kvfM7M7MysNGhnBbZHZi2NFhlkN2lGlgNrW0YjeQHhOrb8r3W+JjezCAnTChAIB1FjmF0t0orKIIjbQI1BOG7+9baXxL0uqR0zQkSyvwrjJv2Dr/+wQg4kNw6sQm6Qg9B+73tmdyQc0tv7Pc/3PF8e5OQVknZn3vd33n/nd86cXbB0w7o1+qPrn2qO/Wn17y+KtbY9GdPXtegLFlRV6Y82t21sXrOieYN+h2FUL1ig/3FrbGNz+0b9qbaV8I+79XmfXXhH9Rf1dWv1O6r0+2Nrn4pt2IyvvVOPbdSrqu6uhv8t0tvWLCifNav8oRV/0ty08dGm2Nq1cMW1zZv01WtXb1wda139Z83wd3hFe3Nri96+JrZh4yPNLY9u3NAcW1MuEEIEGUUw0NQaa2/X2zdueKpp41Mbmv3wW14siK5u2rh63Vq4Nb72RnytQeHL/XNhXXv7uqbVMXyJKLo64EsovphQlSe14o2PNgMAa5uaYytam+9b19razK4442XuF3uxP7q6/U8bN6zr2Ix/97G/B9VVretWxFrdyz8YW9McLGzb0PxoM15p3Ybg7KZ1a121123wfhmY8cu6Dava3as/1tyx8dGNm1ub8eqz3Kv7W9at3Vi3YUNsc7AI/7k0tmZ16+ZHAbeg3Lp6bfOyDatXBuUVMcAPfgr6AdJVa9c0r90YLGxZvaF94/K1K/GHgg3N3r8LN6xe9WT+B//G2Ip29/oBQH/V6rWPeb+QWptjK1evXRVUVza3xJ5q3bgUFMD3deQB8TWuW72WYcq76tKOIN3s/k1Yum7DGvyT6P5JWLF6Y3vQt2n1yo1PBsUnm1GJoG8l+Bn8