 _ Dictionary new.	"replace fonts currently in use in the image"	allFonts do: [ :font |		fontName _ font name asSymbol.		fontName last isDigit ifFalse: [			sz _ font pointSize.			fontName _ (font familyName asString,				(sz < 10 ifTrue: [ '0',sz printString] ifFalse: [ sz printString]))					asSymbol].		(nameTransformDict includesKey: fontName)			ifTrue:				[newFont _ allFonts detect: [:f | f name = (nameTransformDict at: fontName)].				fontTransformDict at: font put: newFont copy]			ifFalse: [Transcript show: 'cannot find ',fontName; cr]		].		"do the 'become:'s in a separate loop to be safe"	fontTransformDict keysAndValuesDo:		[:oldF :newF |			newF reset.			Transcript show: 'converting ', oldF name, ' to ', newF name; cr.			oldF become: newF].	Smalltalk garbageCollect.	"Remove entries for old fonts in the TextConstants dictionary"	#(NewYork ComicPlain ComicBold) do: [ :oldName |		TextConstants removeKey: oldName asSymbol ifAbsent: []].	"Somehow some font defaults get reset to different sizes during Accufont installation... need to set these back to the appropriate defaults."	Preferences setSystemFontTo: ((TextStyle named: 'Accuny') fontNamed: 'Accuny10').	Preferences setCodeFontTo: ((TextStyle named: 'Accuny') fontNamed: 'Accuny10').	Preferences setEToysFontTo: ((TextStyle named: 'Accujen') fontNamed: 'Accujen10').	Preferences setFlapsFontTo: ((TextStyle named: 'ComicSansMS') fontOfPointSize: 12).	Smalltalk garbageCollect. "make sure old StrikeFont instances are gone"!